import Link from "next/link";
import Navbar from "../components/Navbar";

const Index = () => {
  return (
    <div>
      <ul>
        <li>
          <Link href="/">
            <a>Home</a>
          </Link>
        </li>
        <li>
          <Link href="/about">
            <a>about</a>
          </Link>
        </li>
      </ul>
      <h1>Home page in action</h1>
    </div>
  );
};

export default Index;
